	(13, 'HOME_PARAGRAPH_1', 'Statuto Fiorentino del 1321, Rubrica 65: \'i fossi e i canali siano riparati, svuotati e raddrizzati al fine di rendere quei territori nuovamente fertili\'. Sulla sponda di uno di quei fossi, Fosso Bandito, abbiamo riparato, svuotato e raddrizzato al fine di rendere nuovamente fertile questo luogo, un tempo Tenuta dell\'Isola, poi Cascine dell\'Isola infine Parco delle Cascine...', NULL, 0, 0, '1', 0, 1),
	(14, 'HOME_PARAGRAPH_1', 'Florentine Statute of the 1321 a.C., Section 65: \'...Ditches and canals will be repaired, emptied and straightened in order to make those lands fertile again\'. On the shore of one of those ditches, Fosso Bandito, we repaired, drained and straightened in order to make fertile again this place, once they call it Island land, then the Island\'s Cascine (Farms), finally Cascine\'s Park ...', NULL, 0, 0, '1', 0, 2),
