INSERT INTO `posts_options` (`id`, `note`, `datefrom`, `dateto`, `title`, `seo_url`, `seo_title`, `subtitle`, `description`, `seo_description`, `seo_keywords`, `related`, `status`, `position`, `posts_id`, `language_id`, `users_id`) VALUES
	(1, NULL, '2014-01-01 01:01:01', '2014-01-01 01:01:01', 'Dizionario Geografico Fisico della Toscana di Emanuele Repetti', 'dizionario-geografico-fisico-della-toscana-di-emanuele-repetti', 'Dizionario Geografico Fisico della Toscana di Emanuele Repetti', NULL, '<p>Chi era Emanuele Repetti? <a href="http://it.wikipedia.org/wiki/Emanuele_Repetti" target="_blank" title="Emanuele Repetti su wikipedia (apre in una nuova pagina)">Leggi la pagina su Wikipedia</a></p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<th>Numero Scheda:</th>\r\n			<td>46020 / 3727</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Denominazione:</th>\r\n			<td>Sala di Brozzi - <a href="#fossobandito" style="text-decoration: underline" title="Fosso Bandito (leggi la descrizione sulla scheda)">Fosso Bandito</a>, Fosso Macinante - Gora di Ognissanti</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Toponimo IGM:</th>\r\n			<td>La Sala - S. Lucia - Canale Macinante (a N)</td>\r\n		</tr>\r\n		<tr>\r\n			<th>x GB:</th>\r\n			<td>1674868</td>\r\n		</tr>\r\n		<tr>\r\n			<th>y GB:</th>\r\n			<td>4851554</td>\r\n		</tr>\r\n		<tr>\r\n			<th>volume - pagine:</th>\r\n			<td>v. 2; 5, p. 339, 469 - 470; 6</td>\r\n		</tr>\r\n		<tr>\r\n			<th>comune - provincia:</th>\r\n			<td>FIRENZE - FI</td>\r\n		</tr>\r\n		<tr>\r\n			<th>popolo:</th>\r\n			<td>S. Lucia alla Sala</td>\r\n		</tr>\r\n		<tr>\r\n			<th>piviere:</th>\r\n			<td>S. Martino a Brozzi</td>\r\n		</tr>\r\n		<tr>\r\n			<th>comunit&agrave;:</th>\r\n			<td>Brozzi</td>\r\n		</tr>\r\n		<tr>\r\n			<th>giurisdizione:</th>\r\n			<td>Sesto</td>\r\n		</tr>\r\n		<tr>\r\n			<th>diocesi:</th>\r\n			<td>Firenze</td>\r\n		</tr>\r\n		<tr>\r\n			<th>compartimento:</th>\r\n			<td>Firenze</td>\r\n		</tr>\r\n		<tr>\r\n			<th>ducato/regno:</th>\r\n			<td>Granducato di Toscana</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h5>Descrizione</h5>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>SALA, SALETTA, SALETTO, SALISSINA, ecc. - Nomi tutti di origine longobarda indicanti un resedio campestre ad uso di villa signorile che in lingua longobarda appellavasi Sala, nome restato tuttora a varii luoghi e casali dellaToscana; tali sono i seguenti: SALA nel Val d&#39;Arno casentinese, SALA DI BROZZI nel Val d&#39;Arno sotto Firenze, SALA DI CALCINAJA nel Val d&#39;Arno pisano, SALA nella Valle dell&#39;Elsa, SALA DI GARFAGNANA, gi&agrave; SALA DEL VESCOVO nella Valle superiore del Serchio, SALA DI LARI nella vallecola della Cascina, SALA DI SANTA LUCE in Val di Fine nelle Colline superiori pisane, SALA DI PIETRASANTA, SALA VECCHIA DI VERSILIA, CASALE DI SALA FUORI DI PORTA LUCCHESE nella Valle dell&#39;Ombrone pistojese, SALETTA DIETRO FIESOLE (gi&agrave; SALA) nel valloncello del Mugnone, SALETTA (gi&agrave; SALETTO) nella Val d&#39;Era, SALETTO DI VELLANO in Val di Nievole, SALETTO DI FAUGLIA in Val di Tora.<br />\r\n<br />\r\nSALA DI BROZZI nel Val d&#39;Arno sotto Firenze. - Contrada che ha lasciato il vocabolo ad un popolo (S. Lucia alla Sala) nella Comunit&agrave; e appena mezzo miglio a scirocco dalla pieve di S. Martino a Brozzi, Giurisdizione di Sesto, Diocesi e Compartimento di Firenze.<br />\r\nRisiede in pianura sulla strada che attraversa da ostro a settentrione il borgo orientale di Brozzi, di cui il popolo della Sala abbraccia la maggiore porzione.<br />\r\nLa memoria pi&ugrave; antica di questa Sala mi sembra quella registrata in una scrittura dell&#39;anno 1058, rogata in Firenze a d&igrave; 20 settembre con la quale donna Teberga del fu Azzo, chiamato Alberto, e moglie di Rolando figlio che fu di altro Azzo, offr&igrave; alla canonica della cattedrale fiorentina tre poderi, uno de&#39;quali situato a Sala, l&#39; altro a Limite el il terzo in Piscina, tutti tre compresi nel piviere di S. Martino a Brozzi. - (LAMI, Mon. Eccl. Flor. pag. 938).<br />\r\nFu creduto da alcuni che cost&agrave; fosse quel monastero di donne indicato all&#39;Articolo QUARACCHII, stato soppresso nel 1316, nel cui popolo era compreso sotto il piviere di S. Stefano in Pane, mentre la chiesa di S. Lucia alla Sala fino dal secolo XIII e stata sempre suffraganea della pieve di Brozzi.<br />\r\nLo stesso Lami (Oper. cit.) produsse copia di altra donazione del 19 agosto 1079 fatta allo stesso capitolo fiorentino consistente in tre predj, posti nei luoghi denominati Commoro, (forse Sanmoro) Sala e Limite.<br />\r\nAnche un documento del 31 dicembre 1381 rogato nel popolo di S. Maria a Verzaja fuori delle mura di Firenze, e relativo alla nomina di un mondualdo o tutore assegnato alla vedova di Segno di Giannino del popolo di S. Lucia alla Sala. - (ARCH. DIPL. FIOR., Opera di S. Jacopo di Pistoja.)<br />\r\nUn altro luogo di Sala esisteva sulla oppposta ripa dell&#39;Arno vicino alla bocca di Greve, ed era quella Sala presso la chiesa di S. Bartolommeo a Cintoja di cui trovasi commemorazione in una carta del 24 febbrajo 1208 riportata dallo stesso Lami. - (Oper. cit. pag, 1452.)<br />\r\nLa parrocchia di S. Lucia alla Sala nel 1833 contava 436 abitanti.</p>\r\n\r\n<div id="fossobandito">&nbsp;</div>\r\n\r\n<p><strong>FOSSO BANDITO</strong>, o <strong>FOSSO MACINANTE</strong>, dell&#39;isola delle Reali Cascine. - Questo gran fosso, che rasenta le mura occid. della citt&agrave; di Firenze presso la Porticciuola d&#39;Ognissanti, e che nei secoli XIV e XV serviva di Gora ai Frati Umiliati del vicino convento per lavare le lane e per gualchiere, nasce dalla pescaja dell&#39;Arno posta dirimpetto alla chiesa e muro d&#39;Ognissanti, di dove per un callone entra in un canale detto delle mulina, perch&egrave; d&agrave; il moto a varie macini sopra e sotto al giardino della Vagaloggia, ridotto ad uso di pubblici bagni; di l&agrave; passa davanti alla porticciuola della citt&agrave;, detta della Gora, per entrare nelle RR. Cascine dell&#39;Isola, dove &egrave; cavalcato sul gran viale d&#39;ingresso da un larghissimo ponte di pietra lavorata. In seguito cammina in linea retta quasi parallelo all&#39;alveo dell&#39;Arno sino che, dopo due miglia di corso, mediante una botte attraversa l&#39;alveo del torrente Mugnone davanti alle mulina del Barco, quindi passa sotto la strada Regia pistojese al borgo di Petriolo, per dirigersi nel piano dell&#39;Osmannoro una, dove raccoglie i fossi e dogaje di quella bassa pianura, finch&egrave; alle mulina di S. Moro, sette miglia lungi dalla sua origine, entra nel fiume Bisenzio, e con esso ritorna nell&#39;Arno al ponte di Signa.<br />\r\nLa costruzione di questo Fosso e dei suoi influenti (fra i maggiori de&#39;quali &egrave; la Dogaja o Fosso Reale) rimonta a un&#39;epoca assai remota; stantech&egrave; tutto il suolo costituente le RR. Cascine dell&#39;Isola, proseguendo fino verso Brozzi, sembra che sia stato formato da uno di quei Bisarni, che allora incontravansi nel corso del fiume. Infatti al di sotto della pescaja d&#39;Ognissanti l&#39;Arno si suddivideva, siccome si &egrave; accennato all&#39;articolo BISARNO sotto Firenze, e lo indica il nome antico d&#39;Isola restato all&#39;I. e R. tenuta delle Cascine, e meglio lo provano li Statuti fiorentini del 1321 (Lib. II, rubr. 63), dove si conosce quanto il Comune di Firenze provvedesse a prosciugare pi&ugrave; che fosse possibile i fertili terreni di alluvione della pianura percorsa dal Fosso Macinante.<br />\r\nL&#39;antico Fosso, o Dogaja, che raccoglie le acque della pianura fra Sesto e Campi, fu prolungato dai granduchi Medicei mediante l&#39;escavazione di quel Fosso Reale, che passa sotto il nuovo ponte della strada Regia lucchese presso al fosso dell&#39;Osmannoro, e di l&agrave; si dirige nel Fosso Macinante alla chiesa di S. Moro.<br />\r\n<br />\r\nGORA DI OGNISSANTI ALLA PORTICCIOLA DI FIRENZE, ossia FOSSO MACINANTE. - Questa Gora, che ha lasciato il suo nome a una strada posta fra le mura della citt&agrave; di Firenze, la piazzetta della Porticciuola, e il borgo di Ognissanti, ci rammenta quel Fosso Bandito o Fosso Macinate dell&#39;Isola delle RR. cascine gi&agrave; descritto al suo articolo, dove si annunzi&ograve;, che nei secoli XIV e XV egli serviva di Gora alle lavorazioni della lana dei Frati Umiliati del vicino convento di Ognisanti. - In prova di che qu&igrave; solamente aggiunger&ograve; la notizia del primo acquisto fatto dai Frati Umiliati di un terreno con casa annessa rasente questa sino d&#39;allora esistente Gora.<br />\r\n&Egrave; un istrumento del 30 maggio 1250, rogato nel monastero di S. Salvadore a Vajano nel distretto di Prato, col quale Jacopo di Mainero Tornaquinci giudice e cittadino fiorentino, ed i figli suoi Follerio e Lottieri venderono a fra Ruffino dell&#39;Ordine dei Frati Umiliati, priore del convento di S. Donato a Torri un appezzamento di terra con casa situato quasi appresso (prope vel quasi prope) la citt&agrave; di Firenze. La qual casa e terreno confinavano, a I&deg;. con la via pubblica; a 2&deg;. Con la terra che fu d&#39;Iacopo Altogradi, e allora della chiesa di S. Lucia mediante la fossa a comune; a 3&deg;. Con i beni della chiesa e canonica di S. Paolo e di Uguccione Pratacozzi, divisi da una fossa a comune; e dal 4&deg;. lato, che corrispondeva verso il fiume Arno, con la via quae tendit per Insulam dicti fluminis Arni; con quella via cio&egrave;, che dopo l&#39;ingrandimento e la costruzione del terzo ed attuale cerchio della citt&agrave; prese il nome di Via Gora. - (TIRABOSCHI, Monum. Veter. Fr. Umiliat. T.I. pag. 230 e seg.) - Vedere FOSSO BANDITO, o MACINANTE dell&#39;Isola delle RR. Cascine.</p>', 'Fosso Bandito - Dizionario Geografico Fisico della Toscana di Emanuele Repetti', 'fosso,bandito,firenze,repetti,cascine,toscana', '9', NULL, 1, 1, 1, 1),
	(2, NULL, '2014-01-01 01:01:01', '2014-01-01 01:01:01', 'Da dove inizia il cambiamento del Parco. Facciamo il punto', 'da-dove-inizia-il-cambiamento-del-parco-facciamo-il-punto', 'Da dove inizia il cambiamento del Parco. Facciamo il punto', NULL, '<p>Prostituzione basta, discoteche altrove (l&#39;ha detto il Comune), ippodromi 2 (difficili da mantenere), piscina c&#39;&egrave;, ristoranti ci sono ad Ovest, Est e al Centro, Parco della Musica (fantastico)... cosa manca? Non sappiamo pensare a niente di pi&ugrave; efficace nel tempo che dedicare ai bambini gli ulteriori grandi cambiamenti di quest&#39;area.<br />\r\n<br />\r\nE&#39; evidente che la possibilit&agrave; di far fare attivit&agrave; divertenti e interessanti ai piccoli, cambier&agrave; l&#39;immagine del Parco agli occhi dei piccoli e dei grandi. I piccoli avranno la possibilit&agrave; di costruire una relazione affettiva, fatta di allegria, dolcezza e libert&agrave;, che li segner&agrave; per sempre, nei confronti di quel pezzo di terra lungo il fiume che li avr&agrave; accolti, negli anni, e dove avranno trovato aria per la loro creativit&agrave; e spazio per allungare le braccia e le gambe, per saltare e correre a perdifiato. Per imparare ad andare in bicicletta, sui pattini, incontrare un cavallo e tanti altri bambini scalmanati e felici.<br />\r\n<br />\r\nGli adulti, di ogni et&agrave; ed estrazione, con famiglia o senza, potranno spaziare su chilometri di percorsi da fare a piedi o su eventuali mezzi ecologici.<br />\r\n<br />\r\nCosa vieta al Parco delle Cascine, con la sua nuova estensione, i nuovi servizi, a puntare ad un&#39;immagine legata al divertimento? Assolutamente nulla. Intelligenza e buon gusto non sono merce rara.<br />\r\n<br />\r\nNon crediamo che sia difficile avere buon senso e puntare a rendere Le Cascine un luogo pi&ugrave; bello, pulito e sicuro. Se poi i progetti sono fatti sulle esigenze vere del pubblico, il successo &egrave; assicurato. .<br />\r\n<br />\r\nPensiamo alle prime ore del giorno, dove tante persone usano il parco per passeggiare o fare sport, perch&egrave; non dargli un posto dove fare una doccia e mettersi in ordine per poi affrontare la giornata di lavoro o di studio.<br />\r\n<br />\r\nPensiamo alla possibilit&agrave; per i turisti di sperimentare i percorsi che furono frequentati da tutta la nobilt&agrave; europea e non, fino a un secolo fa.<br />\r\n<br />\r\nPensiamo ad un centro servizi dove si possa sostare all&#39;aperto e al riparo, dove pranzare, rinfrescarsi, navigare in internet, leggere.<br />\r\n<br />\r\nPensiamo a pi&ugrave; attivit&agrave; per i bambini, centri estivi a tema, attivit&agrave; nei fine settimana di tutto l&#39;anno, possibilit&agrave; di gioco libero e con strutture fisse a norma che ne stimolino l&#39;attivit&agrave; motoria.<br />\r\n<br />\r\nPensiamo ad un percorso lungo un giorno, lungo tutto il greto dell&#39;Arno, da fare in bicicletta o a cavallo, partendo dal Ponte alla Vittoria per arrivare ai Renai di Signa.<br />\r\n<br />\r\nPensiamo...</p>', 'Il presente del Parco delle Cascine', NULL, '10', NULL, 2, 2, 1, 1),
	(3, NULL, '2014-01-01 01:01:01', '2014-01-01 01:01:01', 'All\'alba una bella corsa di qualche chilometro', 'All-alba-una-bella-corsa-di-qualche-chilometro', 'Fosso Bandito - present', NULL, '... doccia al nuovo spogliatoio.<br><br>\r\nColazione al Bar un buon t&egrave;, un caff&egrave;, qualcosa di buono da mangiare. <br><br>\r\nSi noleggia un bicicletta elettrica e se ne approfitta per fare una bella gita nel Parco ed in citt&agrave;. <br><br>\r\nSi torna per lasciare la bici, pranzo veloce, una pizza cotta nel forno a legna ed una Coca, un caff&egrave; e via. <br><br>\r\nNel pomeriggio una sosta nell\'anfiteatro, c\'&egrave; un artista di strada che intrattiene i bambini con i suoi costumi fantastici, i giochi divertenti, i piccoli doni per i pi&ugrave; piccoli, intanto si pu&ograve; navigare in internet... un gelato... i bambini incantati si siedono in cerchio intorno all\'artista, i genitori e alcuni ragazzi si siedono sui gradoni intorno, sbirciano e chiacchierano riposandosi dopo avere a lungo passeggiato. <br><br>\r\n\r\nUna prima ondata di persone si avvia ad ordinare la cena in pizzeria, hanno poco tempo, tra poco al Palazzo della Musica inizia lo spettacolo, stasera un concerto jazz li far&agrave; sognare. <br><br>\r\n\r\nArrivano persone un po\' a tutte le ore, si cena, si beve, si fanno progetti per il giorno successivo che &egrave; domenica... <br><br>\r\n\r\nAl ristorante arrivano persone eleganti, ceneranno e si tratterranno al tavolo, pi&ugrave; tardi alcuni piccoli gruppi ceneranno dopo il concerto, tutti impegnati in conversazioni musicali. <br><br>\r\n\r\nDalla rampa sul lato si accede alla terrazza sul tetto, un tetto non troppo alto, ma &egrave; il cambio della visuale che rende interessante salire, i suoni sono diversi, il Palazzo della Musica &egrave; l&igrave; che pare di toccarlo, si pu&ograve; avere un aperitivo quass&ugrave; o qualcos\'altro. Lo sguardo arriva fino al Ponte alla Vittoria, basta poco per arrivare pi&ugrave; in l&agrave;, le auto si vedono ma sono abbastanza lontane da risultare innocue. La tranvia passa veloce e si ferma proprio l&igrave;, a un passo, sar&agrave; semplice poi tornare a casa. <br><br>\r\n\r\nC\'&egrave; gente che arriva, si ferma nella luce diffusa del giardino accogliente, &egrave; aperto ma protetto, illuminato ma intimo, ormai tutti sanno che ci sar&agrave; qualcosa da fare, da vedere, che intratterr&agrave; e accompagner&agrave; verso la notte coloro che avranno voglia di passare. <br><br>\r\n\r\nAdesso vorrei un buon caff&egrave;... ecco.', 'Fosso Bandito - il futuro del parco delle Cascine di Firenze', NULL, '11', NULL, 3, 3, 1, 1),
	(4, NULL, '2014-01-01 01:01:01', '2014-01-01 01:01:01', 'Addio Meccan&ograve; e Central Park una nuova porta per le Cascine', 'Addio-Meccano-e-Central-Park-una-nuova-porta-per-le-Cascine', 'Addio Meccan&ograve; e Central Park una nuova porta per le Cascine', NULL, '<p>Articolo di ERNESTO FERRARA. Fonte: <a href="http://ricerca.repubblica.it/repubblica/archivio/repubblica/2013/05/09/addio-meccano-central-park-una-nuova-porta.html" class="underline" target="_blank" title="">La Repubblica</a> del 9 maggio 2013</p>\r\n<p>MECCAN&Ograve; e Central Park alla riscossa. Dopo anni di progetti  rimasti sulla carta e senza nemmeno un abbozzo visibile della  rivoluzione delle Cascine teorizzata da Renzi fin dal 2009,  Palazzo Vecchio prova a ripartire dalle due "Cenerentole" del  parco. Dalle vecchie discoteche ormai ridotte a ruderi dopo anni  di abbandono: una piazza-giardino con bar nascer&agrave; sulle  ceneri del Meccan&ograve;, un ristorante esclusivo con un  anfiteatro all\'aperto stile "Versiliana" prender&agrave; il posto  del vecchio Central Park. Non &egrave; per l\'estate alle porte,  semmai per la prossima, quella del 2014: &laquo;Ma riqualificando  il Meccan&ograve; e il Central Park cambieremo la porta d\'accesso  delle Cascine. Sar&agrave; l\'inizio della svolta&raquo;, garantisce  l\'assessore all\'urbanistica del Comune Elisabetta Meucci. I  resti del Meccan&ograve;, distrutto da un incendio nel 2008,  saranno abbattuti del tutto: al suo posto nascer&agrave; una grande  piazza-giardino da 5.800 metri quadrati collegata al parco della  Catena, con al centro un "chiosco" da 140 metri quadrati che  verr&agrave; adibito a bar. A fare i lavori sar&agrave; direttamente  il Comune con i soldi del &laquo;piano citt&agrave;&raquo; concessi  dal governo Monti anche se non erogati: 1 milione di euro per  mettere a posto il verde e costruire il nuovo bar "chalet"  (avr&agrave; l\'"ossatura" in metallo e le pareti di vetro con  tende avvolgibili in bamb&ugrave;). Quando si parte? Dipende dai  soldi. Ad ora le ruspe sono previste entro l\'anno, anche se uno  sponsor potrebbe finanziare anche prima il semplice abbattimento  dei resti della vecchia discoteca, un intervento che costa circa  50 mila euro. In Palazzo Vecchio per&ograve; si conta su uno sprint  dei fondi, visti i buoni rapporti col nuovo ministro alla  coesione territoriale, il toscano (d\'adozione) Carlo Trigilia.  Andr&agrave; anche fatta una gara per la concessione, per trovare il gestore dello chalet: &laquo;Non un\'attivit&agrave; di  ristorazione verae propria ma un bar-gelateria per famiglie e  bambini: nessuna competizione con il Central Park&raquo;, tiene a  dire l\'assessore Meucci, convinta che l\'obiettivo estate 2014  sia pi&ugrave; che verosimile. Il Central Park rinascer&agrave;  invece grazie alla cordata di imprenditori fiorentini che si sono  aggiudicati il bando di Palazzo Vecchio, la societ&agrave; Ark,  guidata da "Mr Runner Pizza" Tiziano Capitani e dal socio  Giovanni Matteini. Loro hanno un progetto ben pi&ugrave; ambizioso:  non solo un locale esclusivo (met&agrave; caff&egrave; e pizzeria  low-cost con ingresso dal parco, met&agrave; ristorante di pesce  con accesso dal viale) ma una piazzaanfiteatro con 450 posti a  sedere sulle gradinate (uno spazio, spiegano i progettisti, che  ospiti dibattiti e piccoli concerti, sorta di "Versiliana"  fiorentina), una struttura con docce e spogliatoi per chi va a  fare footing nel parco (l\'idea &egrave; quella di far pagare  tariffe bassissime ai runner che ne usufruiranno) e un punto  noleggio per 50 bici e auto elettriche, come chiesto dal  responsabile del masterplan Cascine, Simone Tani. L\'ok del  Comune ai lavori di fatto c\'&egrave; gi&agrave;, manca quello della  Soprintendenza: &laquo;Ma ci dovremmo essere, per la primavera  2014 ce la possiamo fare&raquo;, spera Capitani. Al Comune la  societ&agrave; che si &egrave; aggiudicata il bando si &egrave;  impegnataa pagare un affitto da 75 mila euro l\'anno, il che  vista la crisi &egrave; una bella scommessa. Capitani &egrave; pronto  a un investimento da 2 milioni di euro, che dar&agrave; lavoro a 50  persone: &laquo; Le Cascine sono un parco magnifico e mi &egrave;  piaciuta fin dall\'inizio l\'idea di Palazzo Vecchio di  riportarci i fiorentini: vorremmo aprire da colazione a cena,  dando un\'occasione ai giovani e alle famiglie&raquo;.</p>', 'Fosso Bandito', NULL, '12', NULL, 4, 4, 1, 1),
	(5, NULL, '2014-01-01 01:01:01', '2014-01-01 01:01:01', 'Attivit&agrave; sulla pianta', 'attivita-sulla-pianta', 'Attivita sulla pianta', NULL, '<ul class="gdl-accordion">\r\n	<li class="gdl-divider">\r\n		<h2 class="accordion-head title-color gdl-title"><span class="accordion-head-image active"></span>Come sar&agrave;?</h2>\r\n		<div class="accordion-content" style="display: block;">\r\n			<div><a href="/assets/images/plant/big/main.jpg" class="fancyboxsingleimage" title="Pianta panormica nuovo Parco Cascine Firenze"><img src="/assets/images/plant/thumbs/main.jpg" alt="Pianta panoramica"></a></div></div>\r\n	</li>\r\n	<li class="gdl-divider">\r\n		<h2 class="accordion-head title-color gdl-title"><span class="accordion-head-image"><img src="/assets/images/icon/plant/ristorante.jpg" alt="Ristorante icona colore"></span>Ristorante</h2>\r\n		<div class="accordion-content" style="display: none;">\r\n			<div><a href="/assets/images/plant/big/ristorante.jpg" class="fancyboxsingleimage" title="Pianta panormaica area ristorante"><img src="/assets/images/plant/thumbs/ristorante.jpg" alt="Icona Ristorante"></a></div>\r\n			<strong>Ristorante</strong>, un posto dove trovare pietanze inusuali, legate all\'ambiente di un parco fluviale, storico e internazionale, una sorpresa, speriamo.</div>\r\n	</li>\r\n	<li class="gdl-divider">\r\n		<h2 class="accordion-head title-color gdl-title"><span class="accordion-head-image"><img src="/assets/images/icon/plant/pizzeria.jpg" alt="Pizzeria icona colore"></span>Pizzeria</h2>\r\n		<div class="accordion-content" style="display: none;">\r\n			<div><a href="/assets/images/plant/big/pizzeria.jpg" class="fancyboxsingleimage" title="Pianta area pizzeria"><img src="/assets/images/plant/thumbs/pizzeria.jpg" alt="Pianta area pizzeria"></a></div>\r\n			<strong>Pizzeria</strong>, un posto dove tutti possono trovare qualcosa da mangiare un po\' a tutte le ore del giorno e della sera... un posto tranquillo e comodo, immerso nel verde, ma in citt&agrave;, una fantastica pizza nel forno a legna o qualcosa di veloce...</div>\r\n	</li>\r\n	<li class="gdl-divider">\r\n		<h2 class="accordion-head title-color gdl-title"><span class="accordion-head-image"><img src="/assets/images/icon/plant/bar.jpg" alt="Bar icon"></span>Bar</h2>\r\n		<div class="accordion-content" style="display: none;">\r\n			<div><a href="/assets/images/plant/big/bar.jpg" class="fancyboxsingleimage" title="Pianta area Bar"><img src="/assets/images/plant/thumbs/bar.jpg" alt="Pianta Bar"></a></div>\r\n			<strong>Bar</strong>, accogliente e mattiniero per una buona colazione, uno spuntino in qualsiasi momento della giornata, fornito di un gelato freschissimo e informato sugli aperitivi del momento.\r\n		</div>\r\n	</li>\r\n	<li class="gdl-divider">\r\n		<h2 class="accordion-head title-color gdl-title"><span class="accordion-head-image"><img src="/assets/images/icon/plant/arena-freewifi.jpg" alt="Icon colore arena wifi"></span>Arena wi-fi</h2>\r\n		<div class="accordion-content" style="display: none;">\r\n			<div><a href="/assets/images/plant/big/arena-freewifi.jpg" class="fancyboxsingleimage" title="Pianta arena wi-fi"><img src="/assets/images/plant/thumbs/arena-freewifi.jpg" alt="Icona colore arena free wifi"></a></div>\r\n		<strong>Arena wi-fi</strong>, navigazione libera immersi nel verde, comodamente seduti ai tavoli o sulle gradinate.</div>\r\n	</li>\r\n	<li class="gdl-divider">\r\n		<h2 class="accordion-head title-color gdl-title"><span class="accordion-head-image"><img src="/assets/images/icon/plant/teatro-aperto.jpg" alt="Teatro all\'aperto icona colore"></span>Teatro</h2>\r\n		<div class="accordion-content" style="display: none;">\r\n			<div><a href="/assets/images/plant/big/teatro-aperto.jpg" class="fancyboxsingleimage" title="Pianta teatro all\'aperto"><img src="/assets/images/plant/thumbs/teatro-aperto.jpg" alt="Teatro all\'aperto"></a></div>\r\n			<strong>Teatro</strong>, la scommessa pi grande e stimolante, la voglia di spaziare e curiosare, musica e intrattenimento, qualche esperimento...</div>\r\n	</li>\r\n	<li class="gdl-divider">\r\n		<h2 class="accordion-head title-color gdl-title"><span class="accordion-head-image"><img src="/assets/images/icon/plant/spogliatoio-sportivi.jpg" alt="Spogliatoio icona colore"></span>Spogliatoio per sportivi</h2>\r\n		<div class="accordion-content" style="display: none;">\r\n			<div><a href="/assets/images/plant/big/spogliatoio-sportivi.jpg" class="fancyboxsingleimage" title="Pianta spogliatoio sportivi"><img src="/assets/images/plant/thumbs/spogliatoio-sportivi.jpg" alt=""></a></div><strong>Area Sportivi</strong>, la svolta, l\'accoglienza, il pensiero che va a farsi un giro all\'estero e torna indietro arricchito di voglia di fare.</div>\r\n	</li>\r\n	<li class="gdl-divider">\r\n		<h2 class="accordion-head title-color gdl-title"><span class="accordion-head-image"><img src="/assets/images/icon/plant/infopoint.jpg" alt="Spogliatoio icona colore"></span>Info point parco</h2>\r\n		<div class="accordion-content" style="display: none;">\r\n			<div><a href="/assets/images/plant/big/infopoint.jpg" class="fancyboxsingleimage"><img src="/assets/images/plant/thumbs/infopoint.jpg" alt="Info point parco"></a></div>\r\n			<strong>Info Point Parco</strong>, abbiamo accennato al fatto che questo parco inizia la sua storia nel 1300 d.c. oggi torna ad estendere le sue possibilit&agrave; di itinerari fino al Parco dei Renai di Signa... prima l\'atmosfera di parco cittadino, poi di parco fluviale ed infine di parco a carattere lacustre... ma per sapere tutto su iniziative, dove andare e fino dove &egrave; possibile arrivare con i mezzi pubblici, passate a trovarci!</div>\r\n	</li>\r\n	<li class="gdl-divider">\r\n		<h2 class="accordion-head title-color gdl-title"><span class="accordion-head-image"><img src="/assets/images/icon/plant/noleggio-bici.jpg" alt="Noleggio bici elettriche icona colore"></span>Noleggio bici elettriche</h2>\r\n		<div class="accordion-content" style="display: none;">\r\n			<div><a href="/assets/images/plant/big/noleggio-bici.jpg" class="fancyboxsingleimage" title="Pianta area noleggio bici elettriche"><img src="/assets/images/plant/thumbs/noleggio-bici.jpg" alt="Pianta area noleggio bici elettriche"></a></div>\r\n			<strong>Noleggio bici elettriche</strong>, e se c\'&egrave; da fare per un giorno intero, con una bici elettrica le possibilit&agrave; si decuplicano in totale indipendenza e se il tempo tiene... vai!</div>\r\n	</li>\r\n	<li class="gdl-divider">\r\n		<h2 class="accordion-head title-color gdl-title"><span class="accordion-head-image"><img src="/assets/images/icon/plant/parcheggio.jpg" alt="Parcheggio icona colore"></span>Parcheggio</h2>\r\n		<div class="accordion-content" style="display: none;">\r\n		<div><a href="/assets/images/plant/big/parcheggio.jpg" class="fancyboxsingleimage" title="Pianta parcheggio"><img src="/assets/images/plant/thumbs/parcheggio.jpg" alt="Pianta parcheggio"></a></div>\r\n		<strong>Parcheggio</strong> gratuito per i clienti.\r\n	</div>\r\n	</li>\r\n</ul>\r\n', 'Fosso Bandito - attivit sulla pianta. Consulta l\'area del futuro parco delle Cascine', NULL, '13', NULL, 1, 5, 1, 1),
