	(8, NULL, '2014-01-01 01:01:01', '2014-01-01 01:01:01', 'Credits', 'credits', 'Credits', NULL, '<h3>ideazione e progettazione grafica web e contenuti video</h3>\r\n<p>Stefania Vanni art Carto</p>\r\n<p>Sito web: <a href="http://www.artcarto.it" title="Artcarto, sito web" class="underline" target="_blank">www.artcarto.it</a> Email: <a href="mailto:artcarto73&#64;gmail.com" title="Invia un\'email a Artcarto" class="underline">artcarto73&#64;gmail.com</a></p>\r\n\r\n<div style="line-height: 8px">&nbsp;</div>\r\n\r\n<h3>Webmaster</h3>\r\n<p>Andrea Fiori - software engineer</p>\r\n<p>Sito web: <a href="http://www.andreafiori.net" title="Andrea Fiori sito web" class="underline" target="_blank">Andrea Fiori</a>. Email: <a href="mailto:a.fiori&#64;cheapnet.it" title="Invia un\'email a Andrea Fiori" class="underline">a.fiori&#64;cheapnet.it</a></p>\r\n', NULL, NULL, '16', NULL, 1, 8, 1, 1),
	(9, NULL, '2014-01-01 01:01:01', '2014-01-01 01:01:01', 'Physical Geographical Dictionary of Tuscany by Emanuele Repetti', 'Physical-Geographical-Dictionary-of-Tuscany-by-Emanuele-Repetti', 'Emanuele Repetti\'s tab', NULL, '<div class="message-box-wrapper blue">\r\n<div class="message-box-title">This page is under construction</div>\r\n<div class="message-box-content">The English version for this page will be soon available</div>\r\n</div>', NULL, NULL, '1', NULL, 1, 1, 2, 1),
	(10, NULL, '2014-01-01 01:01:01', '2014-01-01 01:01:01', 'Where the change start', 'Where-the-change-start', 'Where the change start', NULL, 'No more prostitution, discos elsewhere ( Municipality decide it), 2 ippodromes (difficult to maintain), there is a swimming pool, there are restaurants in the West, East and Centre, Music\'s Park (fantastic) ... what\'s missing? We really think of nothing more effective in the long terms than dedicate to the childrens the  other main changes in this area.\r\n<br><br>\r\nIt \' s clear that the opportunity to do fun and interesting activities  for children, will change the image of the Park in the eyes of children and adults. The little ones will have the opportunity to build an emotional relationship, full of happiness, sweetness and freedom, that will mark them forever, that piece of land along the river that will have met over the years and where they have found the air to their creativity and space to stretch their arms and legs to jump and run at breakneck speed. To learn how to ride a bike, on skates, meet a horse and many other children rowdy and happy. .\r\n<br><br>\r\nThe adults of all ages and backgrounds, with or without family, will sweep over miles of trails by foot or with any ecological vehicles. .\r\n<br><br>\r\nWhat prohibits the Cascine Park, with its new extension, new services, to point to an image related to the fun? Absolutely nothing. Intelligence and good taste are not a rare commodity. .\r\n<br><br>\r\nWe do not believe that it is difficult to have common sense and aim at making Cascine\'s Park a beautiful place, clean and safe. And if the projects are made on the true needs of the public, success is assured. .\r\n<br><br>\r\nWe think the early hours of the day, where many people use the park for walking or sports, why not giveithem a place to take a shower and get in order to start the day\'s work or study. .\r\n<br><br>\r\nThink about the possibilities for tourists to experience the paths that were attended by all the European nobility and not until a century ago. .\r\n<br><br>\r\nThink about a service center where you can relax outdoors and away, to dine in, freshen up, surf the internet, read. .\r\n<br><br>\r\nWe think of more activities for children, summer camps, themed activities during weekends throughout the year, with the possibility of free play and fixed structures under which stimulate motor activity. .\r\n<br><br>\r\nConsider a path that last one day, along the shore of the Arno river, for biking or horseback, starting from the Victoria Bridge to get to the Renai Park in Signa. .\r\n<br><br>\r\nWe think about ...\r\n', NULL, NULL, '2', NULL, 1, 2, 2, 1),
	(11, NULL, '2014-01-01 01:01:01', '2014-01-01 01:01:01', 'At dawn a nice run a few kilometers', 'At-dawn-a-nice-run-a-few-kilometers', 'Fosso Bandito - presente', NULL, 'At dawn a nice run a few kilometers\r\n<br><br>\r\n... shower in the locker room again.\r\n<br><br>\r\nBreakfast  with  a good tea, coffee, something good to eat.\r\n<br><br>\r\nYou hire an electric bike and you took the opportunity to take a nice walk along the park and in the city.<br>\r\nReturn to leave the bike, quick lunch, a pizza cooked in a wood oven and a Coke, a cup of coffee and go.<br>\r\nIn the afternoon, a stop in the amphitheater, there is a street artist who entertains children with its fantastic costumes, funny games, small gifts for the little ones, while you can surf the internet ... an ice cream ... enchanted children sit in a circle around the artist, some parents and children sit on the steps around, peering and chat resting after having walked for a long time.\r\n<br><br>\r\nA first wave of people will start to order dinner in a pizzeria, have little time, soon the Music Palace starts the show, a jazz concert tonight will make them dreaming.\r\n<br><br>\r\nPeople arrive a little at all hours, you can dine, drink and make plans for the next day which is Sunday ...\r\n<br><br>\r\nPeople come to the elegant restaurant, dine and will hold off the table, later some small groups will dine after the concert, all engaged in conversations about music.\r\n<br><br>\r\nThe ramp on the side leads to the terrace on the roof, the roof is not too high, but it is the change of view that makes it interesting, the sounds are different, the Music Palace is so near that you can almost touch it, you can have a drink up here or something else. The view reaches to Ponte alla Vittoria, just to get a little farther, you can see the cars but they are far enough to be harmless. The tramway goes fast and stops right there, one step, then it will be easy to go home.\r\n<br><br>\r\nThere are people who come, it stops in the diffused light of the cozy garden that\'s open but protected, lit but intimate, everyone knows that there will be something to do, to see, that will entertain and accompany you to the night, who will want to.\r\n<br><br>\r\nNow I want a good coffee ... Here you are.\r\n', NULL, NULL, '3', NULL, 1, 3, 2, 1),
	(12, NULL, '2014-01-01 01:01:01', '2014-01-01 01:01:01', 'Goodbye Meccan&ograve;', 'goodbye-meccano', 'Goodbye Meccan&ograve;', NULL, '<div class="message-box-wrapper blue">\r\n<div class="message-box-title">This page is under construction</div>\r\n<div class="message-box-content">The English version for this page will be soon available</div>\r\n</div>', NULL, NULL, '4', NULL, 1, 4, 2, 1),
	(13, NULL, '2014-01-21 01:01:01', '2014-01-01 01:01:01', 'Activities on the map', 'activity-on-the-map', 'Activities on the map', NULL, '<ul class="gdl-accordion">\r\n\r\n	<li class="gdl-divider">\r\n		<h2 class="accordion-head title-color gdl-title"><span class="accordion-head-image active"></span>The progect (will be like?)</h2>\r\n		<div class="accordion-content" style="display: block;">\r\n		<div><a class="fancyboxsingleimage" href="/assets/images/plant/big/main.jpg" title=""><img alt="" src="/assets/images/plant/thumbs/main.jpg"></a></div>\r\n		</div>\r\n	</li>\r\n	\r\n	<li class="gdl-divider">\r\n	<h2 class="accordion-head title-color gdl-title"><span class="accordion-head-image active"><img alt="Restaurant icon" src="/assets/images/icon/plant/ristorante.jpg"></span>Restaurant</h2>\r\n	<div class="accordion-content" style="display: none;">\r\n	<div><a class="fancyboxsingleimage" href="/assets/images/plant/big/ristorante.jpg" title="Restaurant plant"><img alt="Plant" src="/assets/images/plant/thumbs/ristorante.jpg" title="Restaurant plant"></a></div>\r\n	<strong>Restaurant</strong>, a place to find unusual dishes, related to the environment of a river park, historical and international, a surprise, we hope.</div>\r\n	</li>\r\n	\r\n	<li class="gdl-divider">\r\n	<h2 class="accordion-head title-color gdl-title"><span class="accordion-head-image active"><img alt="Pizzeria icon" src="/assets/images/icon/plant/pizzeria.jpg"></span>Pizzeria</h2>\r\n	<div class="accordion-content" style="display: none;">\r\n	<div><a class="fancyboxsingleimage" href="/assets/images/plant/big/pizzeria.jpg" title="Pizzeria plant"><img alt="Pizzeria plant" src="/assets/images/plant/thumbs/pizzeria.jpg"></a></div>\r\n	<strong>Pizzeria</strong>, a place where everyone can find something to eat, at any hour of the day and evening ... a quiet and comfortable place, in the green, but in the city, a fantastic pizza in the wood oven or something fast ...</div>\r\n	</li>\r\n\r\n	<li class="gdl-divider">\r\n	<h2 class="accordion-head title-color gdl-title"><span class="accordion-head-image active"><img src="/assets/images/icon/plant/bar.jpg" alt="Bar icon"></span>Bar</h2>\r\n	<div class="accordion-content" style="display: none;">\r\n	<div><a class="fancyboxsingleimage" href="/assets/images/plant/big/bar.jpg" title="Bar plant"><img alt="Bar plant" src="/assets/images/plant/thumbs/bar.jpg"></a></div>\r\n	<strong>Bar</strong>,Cozy and early open for a good breakfast, a snack at any time of the day, equipped with a fresh ice cream and informed about new cocktails in town.</div>\r\n	</li>\r\n\r\n	<li class="gdl-divider">\r\n	<h2 class="accordion-head title-color gdl-title"><span class="accordion-head-image active"><img alt="Wi-fi area" src="/assets/images/icon/plant/arena-freewifi.jpg"></span>Wi-fi Area</h2>\r\n	<div class="accordion-content" style="display: none;">\r\n	<div><a class="fancyboxsingleimage" href="/assets/images/plant/big/arena-freewifi.jpg" title="Wi-fi plant"><img alt="Icona colore arena free wifi" src="/assets/images/plant/thumbs/arena-freewifi.jpg"></a></div>\r\n	<strong>Free wi-fi</strong>, Free navigation in the green, sit at the tables or in the stands.</div>\r\n	</li>\r\n\r\n	<li class="gdl-divider">\r\n	<h2 class="accordion-head title-color gdl-title"><span class="accordion-head-image active"><img alt="Theater" src="/assets/images/icon/plant/teatro-aperto.jpg"></span>Theater</h2>\r\n	<div class="accordion-content" style="display: none;">\r\n	<div><a class="fancyboxsingleimage" href="/assets/images/plant/big/teatro-aperto.jpg" title="Pianta teatro all\'aperto"><img alt="Teatro all\'aperto" src="/assets/images/plant/thumbs/teatro-aperto.jpg"></a></div>\r\n	<strong>Theatre</strong>, big and stimulating challenge, the desire to wander and browse, music and entertainment, some experiment ...</div>\r\n	</li>\r\n\r\n	<li class="gdl-divider">\r\n	<h2 class="accordion-head title-color gdl-title"><span class="accordion-head-image active"><img alt="Area Sports" src="/assets/images/icon/plant/spogliatoio-sportivi.jpg"></span>Area Sports</h2>\r\n	<div class="accordion-content" style="display: none;">\r\n	<div><a class="fancyboxsingleimage" href="/assets/images/plant/big/spogliatoio-sportivi.jpg" title="Pianta spogliatoio sportivi"><img alt="" src="/assets/images/plant/thumbs/spogliatoio-sportivi.jpg"></a></div>\r\n	<strong>Area Sports</strong>, the turning point, the reception, the thought that run to take a trip abroad and come back enriched with enthusiasm and news.</div>\r\n	</li>\r\n\r\n	<li class="gdl-divider">\r\n	<h2 class="accordion-head title-color gdl-title"><span class="accordion-head-image active"><img alt="" src="/assets/images/icon/plant/infopoint.jpg"></span>Info point park</h2>\r\n	<div class="accordion-content" style="display: none;">\r\n	<div><a class="fancyboxsingleimage" href="/assets/images/plant/big/infopoint.jpg"><img alt="Info point parco" src="/assets/images/plant/thumbs/infopoint.jpg"></a></div>\r\n	<strong>Info Point Park</strong>, we mentioned the fact that this park begins its history in 1300 A.C. Now back to extend its range of itineraries to the Parco dei Renai Signa ... before the atmosphere of the city park, then a river park and finally a lake park ... but to know everything about events, where to go and where you can get to by public transport, come and visit us!</div>\r\n	</li>\r\n\r\n	<li class="gdl-divider">\r\n	<h2 class="accordion-head title-color gdl-title"><span class="accordion-head-image active"><img alt="Noleggio bici elettriche icona colore" src="/assets/images/icon/plant/noleggio-bici.jpg"></span>Rent a bike</h2>\r\n	<div class="accordion-content" style="display: none;">\r\n	<div><a class="fancyboxsingleimage" href="/assets/images/plant/big/noleggio-bici.jpg" title="Rental electric bikes"><img alt="Rental electric bikes" src="/assets/images/plant/thumbs/noleggio-bici.jpg"></a></div>\r\n	<strong>Rental electric bikes</strong>, and if there are things to do for a whole day, with an electric bike possibilities increases tenfold in total independence and if the weather holds ... Go!</div>\r\n	</li>\r\n\r\n	<li class="gdl-divider">\r\n	<h2 class="accordion-head title-color gdl-title"><span class="accordion-head-image active"><img alt="Parking area" src="/assets/images/icon/plant/parcheggio.jpg"></span>Parking</h2>\r\n	<div class="accordion-content" style="display: none;">\r\n	<div><a class="fancyboxsingleimage" href="/assets/images/plant/big/parcheggio.jpg" title="Pianta parcheggio"><img alt="Pianta parcheggio" src="/assets/images/plant/thumbs/parcheggio.jpg"></a></div>\r\n	<strong>Parking</strong>, free parking for customers.</div>\r\n	</li>\r\n</ul>', 'Restaurant\r\nPizzeria\r\nBar\r\nWi-Fi Area\r\nTheater\r\nArea Sports\r\nRent a bike\r\nParking\r\nInfo point park', NULL, '5', NULL, 1, 5, 2, 1),
