INSERT INTO `timeline` (`id`, `note`, `century`, `year`, `date`, `image`, `title`, `description_lang1`, `description_lang2`, `status`) VALUES
	(1, '1300', 1300, 1321, '1300-01-01 22:00:37', '1321.jpg', NULL, 'Tanto difficile &egrave; datare la nascita del Parco delle Cascine, in questa data si hanno le prime citazioni del terreno a ovest di Firenze. In realt&agrave; sono le prime citazioni legate ai suoi fossi, con le raccomandazioni per una manutenzione volta a rendere di nuovo fertili i terreni, in quel momento paludosi e spesso allagati. Negli statuti Fiorentini del 1321 Rubrica 65 si ordina di sistemare i fossi, tra questi il <strong>Fosso Bandito</strong>, oggi Fosso Macinante. \r\nNonostante la raccomandazione, nel 1333 vi fu un\'alluvione disastrosa.', 'Is so difficult to date the birth of the Parco delle Cascine, on this date we have the first mention of the land west of Florence. In fact they are the first citations related to its ditches, with recommendations for maintenance designed to make the land fertile again, at that time marshy and often flooded. The statutes Fiorentini 1321 Book 65 is ordered to fix the ditches, including the <strong>Fosso Bandito</strong>, today Macinate ditch.\r\nDespite the recommendation, in 1333 there was a flood disaster.', NULL),
	(2, '1563', 1500, 1531, '1531-01-01 22:00:37', '1531.jpg', NULL, 'La Tenuta dell\'Isola, questo nome si deve alla posizione particolare, poich&egrave; &egrave; un terreno tra l\'Arno, il <strong>Fosso Bandito</strong> e il Mugnone, &egrave; gi&agrave; propriet&agrave; dei Medici. Un po\' agricola e un po\' dedicata alla caccia. Alessandro de\' Medici acquista i terreni circostanti, traccia strade che si immettono nel viale centrale, il viale dei Pini, e la destinazione a pascoli e coltivazioni fanno presumere che in quel tempo il nome divenne Cascine dell\'Isola.', 'The estate of the island, this name is due to the particular location, as it is a land between the Arno, the <strong> Fosso Bandito</strong> and the Mugnone, is already owned by the Medici. A little \'farm and a little\' dedicated to hunting. Alessandro de \'Medici bought the land surrounding track roads which reach the central boulevard, the Avenue of Pines, and the destination to pastures and crops suggest that at that time the name became Cascine island.', NULL),
	(3, '1563', 1500, 1563, '1531-01-01 22:00:37', '1563.jpg', NULL, 'Per Cosimo I le Cascine dell\'Isola sono interessanti pi&ugrave; per la vicinanza al Palazzo che per la loro produttivit&agrave;. Fosso Bandito fu allungato e riparato, partiva a monte di Ognissanti, deviando tramite una chiusa, le acque dell\'Arno, portava l\'acqua in quel quartiere e portava via l\'acqua in caso di pioggia, la portava verso Est, fino ad incrociarsi col Mugnone per poi riversarsi in Arno nei dintorni di Signa.', 'For Cosimo I Cascine the island are more interesting because of the proximity to the Palace for their productivity. Bandit ditch was lengthened and repaired, started upstream of All Saints, diverting through a closed, the waters of the Arno, carried water in that neighborhood and carried away the water in case of rain, took her to the East, to cross with Mugnone and subsequently into the Arno near Signa.', NULL),
	(4, '1737', 1700, 1737, '2013-06-14 23:07:32', '1737.jpg', NULL, 'Dopo aver rappresentato fonte di reddito e terreno di svago per i vari regnanti di Firenze e Granduchi di Toscana, dopo averne sub&igrave;to i capricci e i dissesti, una donna della famiglia de\' Medici, Anna Maria Luisa, dopo la morte del fratello Giangastone, che nessuna attitudine al governo pare dovesse avere, impone al nuovo Granduca un documento dove il governo si impegna a restituire al popolo fiorentino l\'area delle Cascine come \'parco per il pubblico passeggio\'.', 'After representing a source of income and land of leisure for the various rulers of Florence and the Grand Dukes of Tuscany, after having suffered the vagaries and instability, a woman of the family de \'Medici, Anna Maria Luisa, after the death of his brother Gian Gastone, it seems that no government should have the attitude, requires the new Grand Duke a document where the government is committed to give back to the people of Florence\'s Cascine the area as \'the park for the public walks\'.', NULL),
	(5, '1765', 1700, 1765, '2013-06-14 23:07:32', '1765.jpg', NULL, 'Sale al governo Pietro Leopoldo d\'Asburgo Lorena, il principe illuminato, che si adoperer&agrave; per la riforma del governo e la bonifica della Toscana.', 'Sale to the government Pietro Leopoldo of Habsburg-Lorraine, the enlightened prince, who will work to reform the government and the reclamation of Tuscany.', NULL),
	(6, '1766', 1700, 1766, '2013-06-14 23:07:32', '1766.jpg', NULL, 'Una pigna cade nella carrozza del Granduca sfiorandolo. Il Granduca fece cos&igrave; abbattere i pini del Viale dei Pini, sostituendoli con dei gelsi, facendone quindi il Viale dei Gelsi.', 'A pine cone falls in the carriage of the Grand Duke touching it. The Grand Duke had thus cut down the pines of the Viale dei Pini, replacing them with the mulberry trees, then making the Avenue of the mulberry trees.', NULL),
	(7, '1786', 1700, 1786, '2013-06-14 23:07:32', '1786.jpg', NULL, 'Pietro Leopoldo abolisce la pena di morte.', 'Pietro Leopoldo abolishes the death penalty.', NULL),
	(8, '1791', 1700, 1791, '2013-06-14 23:07:32', '1791.jpg', NULL, 'Ferdinando III di Lorena, figlio di Leopoldo, viene incoronato. Le Cascine dell\'Isola vengono definitivamente trasformate in Parco per il Pubblico Passeggio. Durante il regno di Ferdinando fu probabilmente istituzionalizzata, per l\'Ascensione, la Festa del Grillo. Pare che la pagana festa, popolarissima ed attesa, sia comparsa nelle cronache in questo periodo. Vi sono diverse teorie, una delle pi&ugrave; affidabili &egrave; quella che ne riconosce l\'ufficialit&agrave; in una finezza del governo. Infatti, in campagna, il grillo pu&ograve; rappresentare una sciagura, in quanto insetto nocivo come le locuste. Pare che la festa si svolgesse fin dall\'alba con la possibilit&agrave; di bere latte appena munto dal bestiame del granduca. Il popolo si sarebbe poi dedicato alla cattura dell\'insetto. Questo avrebbe portato una disinfestazione rapida e il popolo contento di aver potuto festeggiare... sancendo l\'indole romantica e un po\' licenziosa del Parco dove amoreggiare. ', 'Ferdinand III of Lorraine, son of Leopold, is crowned. Le Cascine Island is permanently transformed into the Park for the Public Walk. During the reign of Ferdinand was probably institutionalized for Ascension, the Festival del Grillo. It seems that the pagan festival, popular and waiting, has appeared in the news at this time. There are several theories, one of the most reliable is the one that recognizes the official in a refinement of the government. In fact, in the countryside, cricket can be a disaster, as pest such as locusts. It seems that the party should take place since the dawn with the option of drinking fresh milk from the cattle of the Grand Duke. The people would then be dedicated to the capture of the insect. This would bring a rapid disinfection and the people happy to have been able to celebrate ... stating the romantic nature and a little \'licentious the park where frolicking.', NULL),
	(9, '1800', 1800, 1800, '2013-06-14 23:07:32', '1800.jpg', NULL, 'Non riporteremo fatti precisi, ma la sensazione che deriva nel leggere le cronache dei primi anni del secolo. L\'incanto ancora intatto, il passeggio romantico e modaiolo, il transito di re e principesse, la nobilt&agrave; e il lusso, quel non so che dato dall\'influenza gi&agrave; importante degli inglesi. Furono in quegli anni fondate la Societ&agrave; per le Corse al Galoppo ed i Canottieri. La bellezza di Firenze e delle Cascine in quel secolo raggiunse l\'apice in tutta Europa ed in America. Ma gi&agrave; alla fine del secolo in questione, una certa nobilt&agrave; protettrice se ne allontana, per rifugiarsi nei pi&ugrave; esclusivi Giardini di Boboli. ', 'Do not bring them to the specific facts, but the feeling that comes when reading the chronicles of the early years of the century. The charm still intact, the romantic and fashionable walking, transit of kings and princesses, nobility and luxury, that I do not know that already important given the influence of the British. They were founded in those years the Society for Horse Racing and Rowing. The beauty of Florence and the Cascine in that century reached its peak in Europe and America. But by the end of the century in question, a certain nobility protector it has gone away, to take refuge in the most exclusive Boboli Gardens.', NULL),
	(10, '1900', 1900, 1900, '2013-06-14 23:07:32', '1900.jpg', NULL, 'Non sappiamo cosa determin&ograve; il declino del Parco, forse il numero dei suoi frequentatori cos&igrave; alto, senza che vi fossero strutture adeguate a tale pressione &egrave; in realt&agrave; la prima causa di devastazione. Corse in auto, in bicicletta, a cavallo, feste di primavera, manifestazioni nazionali ginniche, e quanto altro si poteva organizzare di pubblico e privato. Nella prima met&agrave; del secolo sono concentrate due guerre, nella seconda abbiamo l\'Alluvione del \'66.\r\nGi&agrave; negli anni \'70 il Comune si interrogava su come fermare il degrado gi&agrave; rappresentato da sporcizia, prostituzione e violenza. L\'aumento del traffico di veicoli all\'interno del Parco risulta esserne una delle cause principali. Fin da subito la limitazione del traffico e l\'estensione dell\'area a verde attrezzato nelle direzioni possibili, apparvero l\'unica soluzione. Ogni progetto &egrave; attenzione, studio. Quindi benvengano i progetti, ma che siano saggi e lungimiranti!\r\n', 'We do not know what led to the decline of the Park, perhaps the number of its visitors so high, that there were no adequate facilities at this pressure is actually the leading cause of devastation. Racing car, bike, horse, spring festivals, national events gymnastics, and anything else you could organize public and private sectors. In the first half of the century, two wars are concentrated in the second we have the Flood of \'66.\r\nBack in the \'70s the City wondering how to stop the degradation of already represented by dirt, prostitution and violence. The increase in vehicle traffic inside the park is being a major cause. Since the beginning of traffic restrictions and the extent of the equipped green in the possible directions, appeared the only solution. Each project is carefully study. So Benvenga projects, but they are wise and farsighted!', NULL),
	(11, '2000', 2000, 2000, '2013-06-14 23:07:32', '2000.jpg', NULL, 'L\'inizio del nuovo millennio pu&ograve; rappresentare l\'inizio di una nuova vita per il Parco, l\'estensione verso Est lungo il corso del fiume si &egrave; in parte realizzata.\r\nL\'ingresso cittadino al Parco vedr&agrave; realizzarsi strutture per la ristorazione, di accoglienza per i runner e per il divertimento di adulti e bambini.\r\n<br><br>\r\nChe la luce inondi questo luogo, che i bambini facciano amicizia con i suoi alberi, che l\'abitudine alla frequentazione lo faccia sentire come il giardino che ogni abitante cittadino vorrebbe avere per s&egrave;. Pulito, sicuro, familiare.', 'The beginning of the new millennium may be the beginning of a new life for the Park, the extension eastward along the course of the river is partly realized.\r\nThe entrance to the national park will be carried dining facilities, shelter for the runner and for the enjoyment of adults and children.\r\n<br>\r\nMay the light inundate this place, that children make friends with its trees, which the habit of frequenting him feel like the garden that each inhabitant citizen would want to have for himself. Clean, safe, family.', NULL);
INSERT INTO `timeline_options` (`id`, `image`, `title`, `description`, `status`, `timeline_id`, `language_id`) VALUES
	(1, '1321.jpg', NULL, 'Tanto difficile &egrave; datare la nascita del Parco delle Cascine, in questa data si hanno le prime citazioni del terreno a ovest di Firenze. In realt&agrave; sono le prime citazioni legate ai suoi fossi, con le raccomandazioni per una manutenzione volta a rendere di nuovo fertili i terreni, in quel momento paludosi e spesso allagati. Negli statuti Fiorentini del 1321 Rubrica 65 si ordina di sistemare i fossi, tra questi il <strong>Fosso Bandito</strong>, oggi Fosso Macinante. ', NULL, 1, 1),
	(2, '1321.jpg', NULL, 'Is so difficult to date the birth of the Parco delle Cascine, on this date we have the first mention of the land west of Florence. In fact they are the first citations related to its ditches, with recommendations for maintenance designed to make the land fertile again, at that time marshy and often flooded. The statutes Fiorentini 1321 Book 65 is ordered to fix the ditches, including the <strong>Fosso Bandito</strong>, today Macinate ditch.\r\nDespite the recommendation, in 1333 there was a flood disaster.', NULL, 1, 2),
	(3, '1531.jpg', NULL, 'La Tenuta dell\'Isola, questo nome si deve alla posizione particolare, poich&egrave; &egrave; un terreno tra l\'Arno, il <strong>Fosso Bandito</strong> e il Mugnone, &egrave; gi&agrave; propriet&agrave; dei Medici. Un po\' agricola e un po\' dedicata alla caccia. Alessandro de\' Medici acquista i terreni circostanti, traccia strade che si immettono nel viale centrale, il viale dei Pini, e la destinazione a pascoli e coltivazioni fanno presumere che in quel tempo il nome divenne Cascine dell\'Isola.', NULL, 2, 1),
	(4, '1531.jpg', NULL, 'The estate of the island, this name is due to the particular location, as it is a land between the Arno, the <strong> Fosso Bandito</strong> and the Mugnone, is already owned by the Medici. A little \'farm and a little\' dedicated to hunting. Alessandro de \'Medici bought the land surrounding track roads which reach the central boulevard, the Avenue of Pines, and the destination to pastures and crops suggest that at that time the name became Cascine island.', NULL, 2, 2),
	(5, NULL, NULL, 'Per Cosimo I le Cascine dell\'Isola sono interessanti pi&ugrave; per la vicinanza al Palazzo che per la loro produttivit&agrave;. Fosso Bandito fu allungato e riparato, partiva a monte di Ognissanti, deviando tramite una chiusa, le acque dell\'Arno, portava l\'acqua in quel quartiere e portava via l\'acqua in caso di pioggia, la portava verso Est, fino ad incrociarsi col Mugnone per poi riversarsi in Arno nei dintorni di Signa.', NULL, 3, 1),
	(8, NULL, NULL, 'For Cosimo I Cascine the island are more interesting because of the proximity to the Palace for their productivity. Bandit ditch was lengthened and repaired, started upstream of All Saints, diverting through a closed, the waters of the Arno, carried water in that neighborhood and carried away the water in case of rain, took her to the East, to cross with Mugnone and subsequently into the Arno near Signa.', NULL, 3, 2),
	(10, NULL, NULL, 'Dopo aver rappresentato fonte di reddito e terreno di svago per i vari regnanti di Firenze e Granduchi di Toscana, dopo averne sub&igrave;to i capricci e i dissesti, una donna della famiglia de\' Medici, Anna Maria Luisa, dopo la morte del fratello Giangastone, che nessuna attitudine al governo pare dovesse avere, impone al nuovo Granduca un documento dove il governo si impegna a restituire al popolo fiorentino l\'area delle Cascine come \'parco per il pubblico passeggio\'.', NULL, 4, 1);
